import { useEffect, useState } from "react";

function App(){
  const[loading, setLoading]=useState(true);
  useEffect(()=>{
    fetch("https://api.coinpaprika.com/v1/tickers")
  },[])
  return(
    <div>
      <h1>The Coins!</h1>
      {loading ? <p>Loading...</p> : null }
    </div>
  )
}

export default App;
